import React from 'react';

function Entry(props) {
  console.log('id is:', props.id)
  return(<div className="entryBox">
    On {props.entry.night}, you slept for {props.entry.duration} hours.      
    <button style={{"marginRight":"10px"}} onClick={() => props.returnUpdate(props.entry.id)}>Update</button>
    <button style={{"marginRight":"20px"}}>Submit</button>

  </div>);
}

export default Entry
